import React, { useState } from 'react';

const EventForm = () => {
  const [formData, setFormData] = useState({
    id: 1,
    name: 'Custom Event',
    category: 'Conference',
    location: 'New York City',
    date: '2024-03-21',
    startTime: '09:00',
    endTime: '17:00',
    description: 'A conference on custom events',
    attendees: ['John Doe', 'Jane Smith'],
    organizer: 'Example Organization'
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted with data:', formData);
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Event Name:
        <input type="text" name="name" value={formData.name} onChange={handleChange} />
      </label>
      <label>
        Category:
        <input type="text" name="category" value={formData.category} onChange={handleChange} />
      </label>
      <label>
        Location:
        <input type="text" name="location" value={formData.location} onChange={handleChange} />
      </label>
      <label>
        Date:
        <input type="date" name="date" value={formData.date} onChange={handleChange} />
      </label>
      <label>
        Start Time:
        <input type="time" name="startTime" value={formData.startTime} onChange={handleChange} />
      </label>
      <label>
        End Time:
        <input type="time" name="endTime" value={formData.endTime} onChange={handleChange} />
      </label>
      <label>
        Description:
        <textarea name="description" value={formData.description} onChange={handleChange} />
      </label>
      <label>
        Attendees:
        <input type="text" name="attendees" value={formData.attendees.join(', ')} onChange={handleChange} />
      </label>
      <label>
        Organizer:
        <input type="text" name="organizer" value={formData.organizer} onChange={handleChange} />
      </label>
      <button type="submit">Submit</button>
    </form>
  );
};

export default EventForm;
